import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for product cards to be visible
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Extract all product prices
    const prices = await page.$$eval('.product-price', elements =>
      elements.map(el => {
        // The innerText might contain the original price on a new line.
        // We split by newline and take the first part, which is the current price.
        return el.innerText.split('\n')[0].trim();
      })
    );

    // Take a screenshot showing the products
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_extracted_prices.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_extracted_prices.png'));

    return {
      success: true,
      action: "Extracted all product prices from the page.",
      extractedData: {
        productPrices: prices
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to extract product prices.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
